import { combineReducers } from "redux";
import authReducer from "./auth"

// case 'AUTH':
//     localStorage.setItem('Profile', JSON.stringify({..action?.data}))
//     return {..state , data : action?.data}
//     default: 
//     return state;


export default combineReducers({authReducer})
